import React, { Component } from 'react';
import './App.css';
import TodoItem from './TodoItem';



class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <TodoItem />
        </header>
      </div>
    );
  }
}


export default App;
